 &nbsp; &nbsp; &nbsp; &nbsp;<ul><li>&nbsp;i) A “school, public” as defined by Article 30, with an average weekday attendance (during any continuous 3-month period during the preceding 12 months) of not less than 50 children who are under 21 years of age.
 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<ul><li>&nbsp;A) Exception: Marijuana producers or processors may not be located within 500 feet from a school located in an Industrial Zone.</li></ul></li><li>&nbsp;ii) A public library.</li><li>&nbsp;iii) A public park which covers an area of not less than 20,000 square feet and has facilities such as a playground, baseball field, football field, soccer field, tennis court, basketball court, or volleyball court.</li><li>&nbsp;iv) <strong>A commercial or residential recreational facility, as defined in Article 30, which serves children under 21 years of age, and has a total area for indoor and outdoor recreation (not including parking) of not less than 20,000 square feet.</strong></li><li>&nbsp;v) A daycare facility licensed by the State of Oregon, unless such daycare facility is established after the Marijuana Business has received all regulatory licensing and approvals, in which case the Marijuana Business shall be permitted to remain in that location, unless the State of Oregon revokes the license for the Marijuana Business.&nbsp;</li></ul></li></ul></li></ul><p>The extent of the buffer is limited to within the Urban Growth Boundary of the City of Grants Pass, Oregon.&nbsp;</p>", 'fieldInfos': [{'fieldName': 'OBJECTID', 'label': 'OBJECTID', 'visible': False}, {'fieldName': 'Shape__Area', 'format': {'digitSeparator': True, 'places': 2}, 'label': 'Shape__Area', 'visible': False}, {'fieldName': 'Shape__Length', 'format': {'digitSeparator': True, 'places': 2}, 'label': 'Shape__Length', 'visible': False}], 'title': "Recreational Facilities Buffer 1000'"}

